import { Component } from 'react'
import { Container , Row , Col , Carousel , Nav, ProgressBar} from 'react-bootstrap'

import './WelcomePage.css'




class WelcomePage extends  Component {
    constructor(props){
      super(props)
      this.state = {
        username: "",
        password: "",
        progress: 0
      }
      this.handleChangeUsername = this.handleChangeUsername.bind(this)
      this.handleChangePassword = this.handleChangePassword.bind(this)
      this.handleSubmit = this.handleSubmit.bind(this)
    }


  handleChangeUsername(event){
    event.preventDefault();
    this.setState({
      username: event.target.value
    })
  }

  handleChangePassword(event){
    event.preventDefault();
    this.setState({
      password: event.target.value
    })
  }




  handleSubmit(event){
    event.preventDefault();
    alert(this.state.username + " " + this.state.password)
    console.log(this.state)


    this.setState({
      username: "",
      password: "",
    })
  }

  render(){

    var addProgress = (e) =>{
        this.setState({
          progress: this.state.progress+10
        })
    }

    var minusProgress = (e) =>{
      this.setState({
        progress: this.state.progress-10
      })
    }

    return(
        <Container>
          <Row>
            <Col>
            <ProgressBar now={this.state.progress} />
            <button onClick={()=>{addProgress()}}> +10 </button>
            <button onClick={()=>{minusProgress()}}> -10 </button>
              <h1>Welcome!</h1>
              <Row>
              <h2>
                A warm welcome to the office! Your remarkable skills will be a great addition to our team and the company.
                We look forward to a mutually beneficial relationship with you!
              </h2>
              </Row>
            </Col>
            <Col>
              <Row>
                <h3> Register Form </h3>
              </Row>
              <Row>
                <form className="register-form" onSubmit={this.handleSubmit}>
                  <input name="username" onChange={this.handleChangeUsername} value={this.state.username}/>
                  <input name="password" onChange={this.handleChangePassword} value={this.state.password}/>
                  <button type="submit" onSubmit={this.handleSubmit}> Register </button>
                </form>

                <Carousel>
                  <Carousel.Item>
                    <img
                      className="d-block w-500"
                      src="data:image/jpeg;base64,"
                      alt="First slide"
                    />
                    <Carousel.Caption>
                      <h3>First slide label</h3>
                      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                  </Carousel.Item>
                  <Carousel.Item>
                    <img
                      className="d-block w-500"
                      src="data:image/jpeg;base64,"
                      alt="Second slide"
                    />

                    <Carousel.Caption>
                      <h3>Second slide label</h3>
                      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                  </Carousel.Item>
                  <Carousel.Item>
                    <img
                      className="d-block w-500"
                      src="data:image/jpeg;base64,"
                      alt="Third slide"
                    />

                    <Carousel.Caption>
                      <h3>Third slide label</h3>
                      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                    </Carousel.Caption>
                  </Carousel.Item>
                </Carousel>
              </Row>
            </Col>
          </Row>
        </Container>
    )
  }
}

export default WelcomePage;
